import React from 'react';

export default function Sidebar({ view, setView, filter, onFilterChange }) {
  const viewOptions = [
    { id: 'kanban', name: 'Kanban Board', icon: '📋' },
    { id: 'list', name: 'List View', icon: '📝' }
  ];

  const statusOptions = [
    { id: 'all', name: 'All Tasks' },
    { id: 'todo', name: 'To Do' },
    { id: 'doing', name: 'In Progress' },
    { id: 'done', name: 'Completed' }
  ];

  const priorityOptions = [
    { id: 'all', name: 'All Priorities' },
    { id: 'high', name: 'High Priority' },
    { id: 'medium', name: 'Medium Priority' },
    { id: 'low', name: 'Low Priority' }
  ];

  return (
    <aside className="w-64 bg-white border-r border-gray-200 flex flex-col">
      <div className="p-6">
        {/* View Toggle */}
        <div className="mb-6">
          <h3 className="text-sm font-medium text-gray-900 mb-3">View</h3>
          <div className="space-y-1">
            {viewOptions.map((option) => (
              <button
                key={option.id}
                onClick={() => setView(option.id)}
                className={`w-full flex items-center px-3 py-2 text-sm rounded-md transition-colors ${
                  view === option.id
                    ? 'bg-indigo-100 text-indigo-700'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                <span className="mr-3">{option.icon}</span>
                {option.name}
              </button>
            ))}
          </div>
        </div>

        {/* Status Filter */}
        <div className="mb-6">
          <h3 className="text-sm font-medium text-gray-900 mb-3">Status</h3>
          <div className="space-y-1">
            {statusOptions.map((option) => (
              <button
                key={option.id}
                onClick={() => onFilterChange('status', option.id)}
                className={`w-full flex items-center px-3 py-2 text-sm rounded-md transition-colors ${
                  filter.status === option.id
                    ? 'bg-indigo-100 text-indigo-700'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                <div className={`w-2 h-2 rounded-full mr-3 ${
                  option.id === 'todo' ? 'bg-gray-400' :
                  option.id === 'doing' ? 'bg-blue-400' :
                  option.id === 'done' ? 'bg-green-400' :
                  'bg-gray-300'
                }`}></div>
                {option.name}
              </button>
            ))}
          </div>
        </div>

        {/* Priority Filter */}
        <div className="mb-6">
          <h3 className="text-sm font-medium text-gray-900 mb-3">Priority</h3>
          <div className="space-y-1">
            {priorityOptions.map((option) => (
              <button
                key={option.id}
                onClick={() => onFilterChange('priority', option.id)}
                className={`w-full flex items-center px-3 py-2 text-sm rounded-md transition-colors ${
                  filter.priority === option.id
                    ? 'bg-indigo-100 text-indigo-700'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                <div className={`w-2 h-2 rounded-full mr-3 ${
                  option.id === 'high' ? 'bg-red-400' :
                  option.id === 'medium' ? 'bg-yellow-400' :
                  option.id === 'low' ? 'bg-green-400' :
                  'bg-gray-300'
                }`}></div>
                {option.name}
              </button>
            ))}
          </div>
        </div>

        {/* AI Features */}
        <div className="mb-6">
          <h3 className="text-sm font-medium text-gray-900 mb-3">AI Features</h3>
          <div className="text-xs text-gray-500 space-y-2">
            <div className="flex items-center">
              <span className="mr-2">✂️</span>
              Auto Summarize
            </div>
            <div className="flex items-center">
              <span className="mr-2">🧠</span>
              Priority Suggestions
            </div>
            <div className="flex items-center">
              <span className="mr-2">#</span>
              Smart Tagging
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <div className="mt-auto p-6 border-t border-gray-200">
        <div className="text-xs text-gray-500">
          <div>AI Task Manager</div>
          <div>v1.0.0</div>
        </div>
      </div>
    </aside>
  );
}
